import React from "react";
import "./GameCard.css";
import SVG from "react-inlinesvg";
const GameCard = props => (
  <div className="card" onClick={() => props.handleClick(props.id)}>
  <h2>{props.name}</h2>
  <SVG src={props.image} />
</div>

);

export default GameCard;
